INSERT INTO `dynamic_advantages` VALUES (1,'es','Audiencia','<p><strong>Audiencia de much&iacute;simos usuarios con intenci&oacute;n de alquilar o comprar una vivienda</strong></p>\r\n\r\n<p>Si publicas tu&nbsp;vivienda&nbsp;con nosotros, much&iacute;simos usuarios ver&aacute;n tu anuncio. Porque si cuelgas&nbsp;tu anuncio en pisosmanresa, aparecer&aacute; simult&aacute;neamente en <strong>Rentalia</strong>. Esto significa que duplicamos tus posibilidades de vender o alquilar con un solo clic. &iexcl;As&iacute; de f&aacute;cil!</p>\r\n','flaticon-high-five','1','0','PAUSED',0),(2,'es','Eficacia','<p><strong>Eficacia: Vende o alquila r&aacute;pido tu piso</strong></p>\r\n\r\n<p>Poner tu vivienda en pisosmanresa es la forma m&aacute;s r&aacute;pida de vender o alquilar.</p>\r\n','flaticon-home-1','1','0','ACTIVED',0),(3,'es','Experiéncia','<p><strong>Experiencia</strong></p>\r\n\r\n<p>&iquest;No sabes qu&eacute; precio fijar para tu vivienda? Pisosmanresa te ayuda. Con nuestra funcionalidad &laquo;<strong>precio sugerido&raquo;</strong></p>\r\n','flaticon-profit','1','0','ACTIVED',0),(4,'es','Facilidad de uso','<p><strong>Facilidad de uso de las aplicaciones de pisomanresa</strong></p>\r\n\r\n<p>&iquest;Sab&iacute;as que el 50 % de los usuarios que busca vivienda lo hace a trav&eacute;s del m&oacute;vil?</p>\r\n\r\n<p>&nbsp;</p>\r\n','flaticon-view','0','0','ACTIVED',0);
/*!40000 ALTER TABLE `dynamic_advantages` ENABLE KEYS */;
