INSERT INTO `dynamic_agencia` VALUES (6,'es','consultin',931860030,0,0,NULL,'info@consultin.es','https://www.facebook.com/Pisos-Manresa-728043333996958/?fref=ts','http://pisosmanresa.es/@pisosmanresa','','https://plus.google.com/u/1/118144178923570267405','','Consultin','<p>Asesores y consultores del sector inmobiliario. Nuestra transparencia, profesionalidad y experiencia, con inmobiliaria en Manresa , y la satisfacci&oacute;n de nuestros clientes es el principal objetivo. Dominamos cada una de las &aacute;reas implicadas en los proyectos y encaminamos cada acci&oacute;n hacia un &uacute;nico objetivo: EL &Eacute;XITO.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Te guiaremos en la financiaci&oacute;n para la compra de tu nueva vivienda o de tu veh&iacute;culo. Somos agentes financieros homologados y registrados con m&aacute;s de 15 a&ntilde;os de experiencia. Si necesitas financiar tu compra no dudes en contactar con nosotros y te obtendremos la mejor hipoteca o pr&eacute;stamo. Financiamos hasta el 100 % m&aacute;s los gastos de la compra de tu vivienda*.</p>\r\n\r\n<p>&nbsp;</p>\r\n','41.7268192','1.8164024','Consultin','','consultin','','','','','','ACTIVED',0),(7,'es','Aimmobles',938749262,0,938749262,'Carrer del Bruc, 125',NULL,'','','','','','Aimmobles','<p>T&rsquo;oferim professionalitat, transpar&egrave;ncia i un assessorament totalment personalitzat. Busquem i trobem les millors solucions r&agrave;pides i eficaces per a cada client.</p>\r\n\r\n<p>El nostre equip de professionals altament qualificats i amb extensa traject&ograve;ria en el sector immobiliari t&rsquo;acompanyar&agrave; en tot el proc&eacute;s.</p>\r\n\r\n<p>Perqu&egrave; vendre, comprar, llogar o finan&ccedil;ar una vivenda &eacute;s un pas important, volem ajudar-te en una decisi&oacute; tan important i que aconsegueixis teus prop&ograve;sits.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Grup aImmobles som un equip de gent compromesa amb la nostra feina. Oferim un servei integral en gesti&oacute; immobili&agrave;ria:</p>\r\n\r\n<ul>\r\n	<li>Venda, compra o lloguer.</li>\r\n	<li>Solucions hipotec&agrave;ries i reunificaci&oacute; de deutes.</li>\r\n	<li>Gesti&oacute; de finques.</li>\r\n	<li>Volem ser el teu referent immobiliari.</li>\r\n</ul>\r\n','41.7268192','1.8164024','Aimmobles','','aimmobles','','','','','','ACTIVED',0),(8,'es','Tot habitatge',938784259,0,938784259,NULL,'','','','','','','Tot habitatge','','41.7253635','1.8202613','Tot habitatge','','tot-habitatge','','','','','','ACTIVED',0),(9,'es','Pisos del Bages',931334951,0,931334951,NULL,'','','','','','','Pisos del Bages','','41.7242421','1.819122','Pisos del Bages','','pisos-del-bages','','','','','','ACTIVED',0),(10,'es','vital immobles',931314350,931314350,931314350,NULL,'','','','','','','vital immobles','','41.7215597','1.815072','Vital Inmobles','','vital-immobles','','','','','','ACTIVED',0),(11,'es','Fedisa Immobles',633777001,633300044,633777001,NULL,'','','','','','','Fedisa Immobles','','41.7237693','1.8169429','Fedisa Inmobles','','fedisa-immobles','','','','','','ACTIVED',0);
