INSERT INTO `dynamic_faqsagentes` VALUES (1,'es','Tiene algún coste formar parte FindHouse',1,'<p>El buscador de ofertas de <strong>FindHouse</strong>&nbsp;es una potente herramienta dise&ntilde;ada para filtrar por diferentes criterios las ofertas publicadas por las empresas. De esta forma podr&aacute;s encontrar las oportunidades de venta que m&aacute;s encajen con tus perfiles comerciales.</p>\r\n','','','tiene-algun-coste-formar-parte-findhouse','','','','','','ACTIVED',0),(2,'es','¿ Como puedo salir en las primeras posiciones de búsqueda ?',2,'<p>Para aparecer en los primeros puestos deber&aacute;s tener el perfil de agente comercial o distribuidor completo, indicando las marcas que llevas actualmente y teniendo tu correo electr&oacute;nico y tel&eacute;fono verificados.</p>\r\n','','','como-puedo-salir-en-las-primeras-posiciones-de-busqueda','','','','','','ACTIVED',0),(3,'es','¿ Se visualizarán mis datos de contacto ?',3,'<p>&Uacute;nicamente ser&aacute;n visibles por la empresa si t&uacute; has confirmado tu inter&eacute;s real en su oferta, dando tu aprobaci&oacute;n v&iacute;a email. En ese momento la empresa podr&aacute; contactar directamente contigo para valorar conjuntamente la propuesta comercial.</p>\r\n','','','se-visualizaran-mis-datos-de-contacto','','','','','','ACTIVED',0);
/*!40000 ALTER TABLE `dynamic_faqsagentes` ENABLE KEYS */;
UNLOCK TABLES;

