INSERT INTO `dynamic_faqsinmobiliarias` VALUES (1,'es','¿Qué incluye el precio del servicio?',1,'<p>El plan Housell incluye todos los servicios necesarios para la venta de una casa: una valoraci&oacute;n profesional de tu vivienda, as&iacute; como fotos y plano, redacci&oacute;n de un anuncio, publicaci&oacute;n en los portales m&aacute;s visitados para que todos sepan que vendes tu casa y filtrado de llamadas para que solo est&eacute;s en contacto con gente realmente interesada, de particular a particular. Si no tienes tiempo, ense&ntilde;amos tu casa por ti y te ayudamos con la negociaci&oacute;n del precio. Adem&aacute;s, tendr&aacute;s a tu disposici&oacute;n un experto dedicado a ti que te asesorar&aacute; de principio a fin, as&iacute; como acceso a la actividad de tu anuncio, interesados, visitas y ofertas desde nuestra plataforma. Tambi&eacute;n te ayudamos con todo el papeleo: nos encargamos de la nota simple, el contrato de arras, el CEE, y te acompa&ntilde;amos el d&iacute;a de la firma en notar&iacute;a.Si quieres saber m&aacute;s sobre c&oacute;mo funcionan, visita nuestra p&aacute;gina de servicio:</p>\r\n','','','que-incluye-el-precio-del-servicio','','','','','','ACTIVED',0),(2,'es','¿ Desde cuándo es agente inmobiliario?',2,'<p>Esta pregunta es v&aacute;lida y muy oportuna tanto si est&aacute;s delante de un agente inmobiliario que trabaja para una inmobiliaria, es decir est&aacute; asalariado en la agencia, o tienes delante de ti al propietario de la misma.</p>\r\n','','','desde-cuando-es-agente-inmobiliario','','','','','','ACTIVED',0),(3,'es','¿ Tiene pensado un plan para vender tu casa?',3,'<p>Vender una vivienda hoy en d&iacute;a , y hacerlo al mejor precio de mercado , no es tarea f&aacute;cil,por eso, deber&iacute;as preguntarte qu&eacute; cosas en concreto son las que esta agencia inmobiliaria va a hacer por ti, para conseguir vender tu casa al mejor precio, en el menor tiempo y con las menores molestias posibles.-</p>\r\n','','','tiene-pensado-un-plan-para-vender-tu-casa','','','','','','ACTIVED',0);
/*!40000 ALTER TABLE `dynamic_faqsinmobiliarias` ENABLE KEYS */;
UNLOCK TABLES;

