INSERT INTO `dynamic_faqspropietarios` VALUES (1,'es','¿Cómo puedo publicar un anuncio como particular?',3,'<p>Si eres particular, puedes&nbsp;<strong>publicar tu anuncio</strong>&nbsp;de inmueble en venta o alquiler o las dos opciones al mismo tiempo totalmente&nbsp;<strong>gratis</strong>.Tu anuncio estar&aacute; a la vista de miles de visitantes que buscan inmuebles.</p>\r\n\r\n<p>(Secuencia de las acciones a realizar por el usuario para publicar un anuncio)</p>\r\n','','','como-puedo-publicar-un-anuncio-como-particular','','','','','','ACTIVED',0),(2,'es','¿Cómo puedo crear una cuenta?',2,'<p>Para recordar tu usuario y contrase&ntilde;a, accede al siguiente enlace:&nbsp;http://phpandfriends.com/, haz clic en &quot;<strong>&iquest;Olvidaste tu contrase&ntilde;a?</strong>&quot;.</p>\r\n','','','como-puedo-crear-una-cuenta','','','','','','ACTIVED',0),(3,'es','¿Cómo puedo ver el teléfono del anunciante?',1,'<p>Si est&aacute;s interesado en alg&uacute;n inmueble, ya sea de alquiler o de compra, y quieres&nbsp;<strong>contactar con el anunciante</strong>, debes fijarte en la ficha del inmueble.</p>\r\n','','','como-puedo-ver-el-telefono-del-anunciante','','','','','','ACTIVED',0);
