ogotipos o en general cualquier indicaci&oacute;n que se refiera a la propiedad de la informaci&oacute;n contenido en el sitio de Internet</p>\r \r <p>Pisosmanresa S.L.&nbsp;se reserva la facultad de efectuar, en cualquier momento y sin previo aviso, modificaciones de la informaci&oacute;n contenida en su Web o en la configuraci&oacute;n y presentaci&oacute;n de &eacute;ste.</p>\r \r <p>Al acceder a este Web se acepta que&nbsp;Pisosbages S.L.&nbsp;no ser&aacute; responsable de consecuencia alguna, da&ntilde;o o perjuicio que se deriven de dicho acceso o uso de la informaci&oacute;n de dicho Web o por el acceso a otras materias en Internet a trav&eacute;s de las conexiones con este Web.</p>\r \r <p>&nbsp;</p>\r \r <p>&nbsp;</p>\r ','','','','','','','','','','','','','','','Aviso Legal | PisosManresa','aviso-legal','aviso-legal','aviso legal','aviso legal','INDEX,FOLLOW','','','ACTIVED',0),(5,'es','Actividades','Actividades','Actividades en Manresa','3','LAS ACTIVIDADES MÁS DIVERTIDAS <br> DE MANRESA','<p>Manresa es famosa por sus monta&ntilde;as, su naturaleza incomparable, su fant&aacute;stica gastronom&iacute;a, su amplia oferta de aventura y deportes, la cultura, los espect&aacute;culos y el shopping. Venga a conocerla y alquile en uno de los pisos de alquiler ofrecidos por PisosManresa en Manresa. Les ofrecemos un sinf&iacute;n de pisos, casas y villas con piscina privada. Disfrute de su tiempo libre con la amplia oferta de actividades Manresa pone a su disposici&oacute;n.</p>\r\n','0','0','2','','0','0','3','<p>0</p>\r\n','0','0','3','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','Actividades Manresa | PisosManresa','','actividades','actividades','actividades','INDEX,FOLLOW','','','ACTIVED',0),(6,'es','Destinos','Descubre Manresa','¡Montañas de arena fina, ocio familiar y mucho más!','2','¿Y si elegimos el mejor destino de Manresa ?','<p>Situada en la provincia de Barcelona, <strong>Manresa</strong> destaca sobre todo por sus fant&aacute;sticas monta&ntilde;as. De hecho, se llama as&iacute; por su color dorada de arena cuando el sol impacta en ella. <strong>&iquest;Preparado para descubrirla?</strong>&nbsp;Disponemos de una amplia oferta de <strong>apartamentos, casas</strong> y villas en <strong>Manresa, Artes, Avinyo , Callus , Castellbell i el Vilar , Castellgali , Castellnou de Bages , El Pont de Vilomara i Rocafort , Fonollosa</strong></p>\r\n\r\n<p><strong>&iexcl;Manresa, su destino de Monta&ntilde;a preferido!</strong></p>\r\n','0','0','2','','0','0','2','<p>0</p>\r\n','0','0','2','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','Destinos Manresa | PisosManresa','destinos','descubre-manresa','descubre manresa','descubra manresa','INDEX,FOLLOW','','','ACTIVED',0),(7,'es','Sobre Nosotros','Sobre Nosotros','ALQUILERES EN MANRESA','29','PisosManresa: Juntos marcamos la diferencia','<p>Nuestra prioridad es ofrecer a nuestros clientes el piso , casa , villa ideal para su vida en Manresa. Estamos en continuo crecimiento y mejor&iacute;a y ofrecemos cada a&ntilde;o novedades para permitirle a Usted y sus familiares disfrutar de una vivienda &uacute;nica.</p>\r\n\r\n<p>La confianza de nuestros clientes es nuestra m&aacute;xima aspiraci&oacute;n. Nuestro compromiso es darle un tiempo de ensue&ntilde;o en Manresa.</p>\r\n\r\n<p>Cada a&ntilde;o es diferente y &eacute;ste ser&aacute; el mejor de todos. Denos su confianza y le daremos lo mejor de nosotros.</p>\r\n\r\n<p>Esto es pisosnmanresa, personas al servicio de las personas, profesionales bien preparados, con experiencia y formaci&oacute;n suficiente para ofrecerle un servicio de alta calidad y m&aacute;xima efectividad a la hora de vender o comprar su vivienda. M&aacute;s de 30 a&ntilde;os de trayectoria empresarial ininterrumpida, una importante red de oficinas en progresivo crecimiento en las principales ciudades del pa&iacute;s y un volumen de negocio que nos ha llevado a intermediar propiedades por valor de m&aacute;s de 500.000.000 de euros en el &uacute;ltimo ejercicio, posicion&aacute;ndonos como la red inmobiliaria m&aacute;s importante del pa&iacute;s, con mayor volumen de ventas y con los mejores &iacute;ndices de satisfaci&oacute;n.</p>\r\n\r\n<p>Hemos conseguido arraigar en nuestros profesionales la filosof&iacute;a b&aacute;sica que ha marcado nuestra historia desde sus or&iacute;genes: el respeto hacia nuestros clientes, la seriedad y honradez en nuestras actividades y la voluntad y el compromiso de servir eficazmente.</p>\r\n\r\n<p>Las credenciales de pisosmanresa son los miles de clientes que han vendido, comprado o alquilado su vivienda con nosotros de manera satisfactoria; este es nuestro mejor aval.</p>\r\n\r\n<p>Esta es nuestra fuerza.</p>\r\n','','','','<ul>\r\n	<li>100% PisosManresa - Gestionamos en exclusiva todos nuestros alojamientos. Lo que nos permite garantizar la calidad.</li>\r\n	<li>Una amplia oferta de alojamientos en Manresa - Gestionamos m&aacute;s de 1000 propiedades. Encontraremos la casa o apartamento &quot;perfecto&quot; para su familia.</li>\r\n	<li>Un equipo profesional y multiling&uuml;e trabajando para su familia. Un equipo especializado en atenci&oacute;n al cliente, volcado en la personalizaci&oacute;n de su estancia.</li>\r\n	<li>Queremos ser sus anfitriones y los de su familia. Para nosotros es un placer poderles ense&ntilde;ar uno de los lugares m&aacute;s sorprendentes del mundo: Manresa.</li>\r\n</ul>\r\n','Servicios ofrecidos','','','<ul>\r\n	<li>Alquiler de apartamentos, estudios, casas y villas en r&eacute;gimen de Self Catering en Manresa. Nuestra &aacute;rea de trabajo se sit&uacute;a sobre todo en las localidades Artes, Avinyo , Callus , Castellbell i el Vilar , Castellgali , Castellnou de Bages , El Pont de Vilomara i Rocafort , Fonollosa</li>\r\n	<li>Compra-venta de propiedades en Manresa.</li>\r\n	<li>Disponemos de un servicio profesional de limpieza, mantenimiento, jardiner&iacute;a y limpieza de piscinas.</li>\r\n	<li>Excursiones guiadas a los principales puntos de inter&eacute;s de Manresa.</li>\r\n	<li>Entradas a parques tem&aacute;ticos como Port Aventura y Aquopolis,...</li>\r\n</ul>\r\n','','','','','','<p>0</p>\r\n','Empresa | PisosManresa','sobre-nosotros','sobre-nosotros','sobre nosotros','sobre nosotros','INDEX,FOLLOW','','','ACTIVED',0),(8,'es','Propietarios','Propietarios','Propietarios pisos , casas , villas en Manresa','29','Propietarios','<p>Nuestro nombre define el objetivo de nuestra empresa ,&nbsp; propietarios tranquilos , protegidos , despreocupados y sin temor a alquilar sus inmuebles y obtener un rendimiento econ&oacute;mico por los problemas que cada vez de manera m&aacute;s frecuente se producen en este tipo de situaciones. Con nuestra gesti&oacute;n integral de tu inmueble no volver&aacute;s a temer por impagos , mantenimiento de la vivienda , desahucios , desperfectos , vandalismo , problemas jur&iacute;dicos , limpieza y hasta si as&iacute; lo deseas puedes olvidarte de las gestiones con la comunidad de propietarios.</p>\r\n\r\n<p><img alt=\"Ilustraciones, imágenes y vectores de stock sobre Building Owner ...\" src=\"https://image.shutterstock.com/image-vector/real-estate-developer-entrepreneur-concept-260nw-487692952.jpg\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Nuestro nombre define el objetivo de nuestra empresa ,&nbsp; propietarios tranquilos , protegidos , despreocupados y sin temor a alquilar sus inmuebles y obtener un rendimiento econ&oacute;mico por los problemas que cada vez de manera m&aacute;s frecuente se producen en este tipo de situaciones. Con nuestra gesti&oacute;n integral de tu inmueble no volver&aacute;s a temer por impagos , mantenimiento de la vivienda , desahucios , desperfectos , vandalismo , problemas jur&iacute;dicos , limpieza y hasta si as&iacute; lo deseas puedes olvidarte de las gestiones con la comunidad de propietarios. Nuestro compromiso es que te olvides de todo lo concerniente a tu inmueble salvo del cobro de la renta.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','','','','','','','','','','','','','','Propietarios apartamentos, casas y villas en Manresa | PisosManresa','propietarios','propietarios','propietarios','propietarios','INDEX,FOLLOW','','','ACTIVED',0),(9,'es','Ofertas','Ofertas en el Bages','Consulta todas nuestras ofertas del Bages','','OFERTAS ÚLTIMA HORA EN MANRESA','<p><strong>Descuentos incre&iacute;bles de hasta un 30% para sus propiedades.</strong></p>\r\n\r\n<p>&iquest;Est&aacute; buscando un alojamiento para sus vacaciones que se ajuste a su presupuesto? Consulte nuestras ofertas de &uacute;ltima hora y reserve sus vacaciones en Manresa a los mejores precios. Reserve los mejores <strong>pisos en Manresa</strong> con un descuento de hasta 30%. Si prefiere alquilar una casa , tambi&eacute;n le aplicamos el 30%.&nbsp;</p>\r\n','0','0','','','0','0','','<p>0</p>\r\n','0','0','','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','Ofertas Manresa | PisosManresa','ofertas-en-bages','ofertas-en-el-bages','ofertas en el bages','ofertasen el bages','INDEX,FOLLOW','','','ACTIVED',0),(10,'es','Política de privacidad','Política de privacidad','Politica de privacidad | Pisosmanresa','29','Política de privacidad','<p><strong>PisosManresa S.L</strong>., propietaria de este sitio web (en adelante, &quot;el Prestador del Servicio&quot;, publica esta declaraci&oacute;n de privacidad (en adelante, &quot;la Pol&iacute;tica de Privacidad&quot;) para informar a sus visitantes (en adelante, &quot;el Usuario&quot;) de la pol&iacute;tica que sigue en el tratamiento de los datos (en adelante, &quot;los Datos&quot;), que se obtienen de las visitas a&nbsp;www.pisosmanresa.es&nbsp;(en adelante, &quot;la P&aacute;gina Web&quot;). El objetivo de la presente Pol&iacute;tica de Privacidad es proteger al m&aacute;ximo la confidencialidad de los datos personales obtenidos.</p>\r\n\r\n<p>El Prestador del Servicio tratar&aacute; los Datos de acuerdo con lo establecido en la Ley Org&aacute;nica 15/1999, de 13 de diciembre, de Protecci&oacute;n de Datos de Car&aacute;cter Personal (en adelante, &quot;LOPD&quot;); as&iacute; mismo declara que tiene inscrito el fichero donde se alojan y tratan los Datos en el Registro General de Protecci&oacute;n de Datos seg&uacute;n lo dispuesto en el art&iacute;culo 26 del mencionado texto.</p>\r\n\r\n<p>El Prestador del Servicio respeta la privacidad de quienes visitan la P&aacute;gina Web. El Usuario tiene el control sobre qu&eacute; tipo de informaci&oacute;n personal, si es que as&iacute; lo quiere, entrega al Prestador del Servicio. La entrega de la informaci&oacute;n por parte del Usuario es voluntaria, salvo en aquellos servicios, para la prestaci&oacute;n de los cuales, la entrega de Datos sea indispensable. La entrega de los Datos, ya sea de forma voluntaria o necesaria para la prestaci&oacute;n de servicios, implica la aceptaci&oacute;n de la presente Pol&iacute;tica de Privacidad. Es responsabilidad del Usuario la consulta previa de la Pol&iacute;tica de Privacidad, antes de la entrega de los Datos; el Prestador del Servicio se reserva el derecho de incluir modificaciones en la presente Pol&iacute;tica de Privacidad.</p>\r\n\r\n<p><strong>CESI&Oacute;N DE DATOS A TERCEROS</strong>.&nbsp;El Prestador del Servicio informa que en ning&uacute;n caso ceder&aacute; o comunicar&aacute; los Datos a terceros, sin la previa y expresa autorizaci&oacute;n del Usuario.</p>\r\n\r\n<p><strong>FINALIDAD DEL TRATAMIENTO.</strong>&nbsp;Mediante la entrega de sus Datos el Usuario consiente que estos sean incorporados en ficheros titularidad del Prestador del Servicio con la exclusiva finalidad de prestar el servicio para el que estos fueron entregados, as&iacute; como para mantenerle informado de novedades y ofertas relacionadas con su actividad profesional a trav&eacute;s del correo electr&oacute;nico, para lo que el Usuario da su autorizaci&oacute;n expresa.</p>\r\n\r\n<p><strong>DERECHO DE ACCESO, RECTIFICACI&Oacute;N, CANCELACI&Oacute;N Y OPOSICI&Oacute;N DE SUS DATOS</strong>.&nbsp;Conforme a lo dispuesto en la LOPD, los Usuarios podr&aacute;n en todo momento ejercitar los derechos de acceso, rectificaci&oacute;n, cancelaci&oacute;n y oposici&oacute;n, sobre los Datos mediante el env&iacute;o de un correo electr&oacute;nico a&nbsp;[email&nbsp;protected]&nbsp;o adjuntando una carta con fotocopia del DNI o similar, al domicilio social de&nbsp;PisosManresa S.L.&nbsp;Avinguda de la Pirelli 08241 Manresa.</p>\r\n\r\n<p><strong>USO DE &quot;COOKIES&quot;</strong>.&nbsp;El Prestador del Servicio informa al Usuario que su servidor web no utiliza &quot;cookies&quot;; en cualquier caso es responsabilidad del Usuario la consulta del manual e instrucciones de su navegador para obtener m&aacute;s informaci&oacute;n sobre esta tecnolog&iacute;a.</p>\r\n\r\n<p><strong>MEDIDAS DE SEGURIDAD</strong>.&nbsp;El Prestador del Servicios garantiza que ha adoptado las medidas t&eacute;cnicas y organizativas necesarias para garantizar la seguridad de los Datos ubicados en sus ficheros con la finalidad de evitar su alteraci&oacute;n, p&eacute;rdida, tratamiento o acceso no autorizado, de acuerdo con lo establecido en el Real Decreto 994/1999, de 11 de junio, por el que se aprueba el Reglamento de medidas de seguridad de los ficheros automatizados que contengan datos de car&aacute;cter personal, o a la norma que le sustituya.</p>\r\n\r\n<p><strong>RESTRICCIONES DE USO Y VERACIDAD DE LOS DATOS.</strong>&nbsp;Es responsabilidad del Usuario utilizar el servicio para fines l&iacute;citos y s&oacute;lo para su uso personal no lucrativo. Adicionalmente es responsabilidad del Usuario responder por la veracidad de los Datos entregados, as&iacute; como de su actualizaci&oacute;n; no pudiendo implicar al Prestador del Servicio por da&ntilde;os o perjuicios causados por la falta de adecuaci&oacute;n a la realidad en dichos Datos.</p>\r\n\r\n<p><strong>JURISDICCI&Oacute;N COMPETENTE Y LEGISLACI&Oacute;N APLICABLE</strong>.&nbsp;La presente la Pol&iacute;tica de Privacidad, as&iacute; como cualquier relaci&oacute;n entre el Usuario y el Prestador del Servicio se regir&aacute;n por la legislaci&oacute;n del reino de Espa&ntilde;a. Para cualquier cuesti&oacute;n litigiosa derivada de la existencia o contenido de esta Pol&iacute;tica de Privacidad o de las relaciones entre el Usuario y el Prestador del Servicio, &eacute;ste se somete a las reglas de determinaci&oacute;n de fuero establecidas por la normativa en vigor de defensa de consumidores y usuarios.</p>\r\n','','','','','','','','','','','','','','','Política de Privacidad | PisosManresa','politica-de-privacidad','politica-de-privacidad','politica de privacidad','politica de privacidad','INDEX,FOLLOW','','','ACTIVED',0),(11,'es','Política de Cookies','Política de Cookies','Politica de cookies | PisosManresa','29','Política de Cookies','<p><strong>Desde PisosManresa.es&nbsp;deseamos informarte que nuestra p&aacute;gina web utiliza cookies para analizar la navegaci&oacute;n de usuarios.</strong></p>\r\n\r\n<p>Las cookies son unos archivos que se instalan en el equipo desde el que accedes a nuestra web con las finalidades que se describen en esta p&aacute;gina.</p>\r\n\r\n<p>Las aplicaci&oacute;nes que utilizamos para obtener y analizar la informaci&oacute;n de la navegaci&oacute;n son:</p>\r\n\r\n<p>Google Analytics:&nbsp;www.google.com/analytics/</p>\r\n\r\n<p>Esta aplicaci&oacute;n ha sido desarrollada por Google, que nos presta el servicio de an&aacute;lisis de la audiencia de nuestra p&aacute;gina. Esta empresa puede utilizar estos datos para mejorar sus propios servicios y para ofrecer servicios a otras empresas. Puedes conocer esos otros usos desde los enlaces indicados.</p>\r\n\r\n<p>Esta herramienta no obtiene datos de los nombres o apellidos de los usuarios ni de la direcci&oacute;n postal desde donde se conectan. La informaci&oacute;n que obtiene esta relacionada por ejemplo con el n&uacute;mero de p&aacute;ginas visitas, el idioma, red social en la que se publican nuestras noticias, la ciudad a la que est&aacute; asignada la direcci&oacute;n IP desde la que acceden los usuarios, el n&uacute;mero de usuarios que nos visitan, la frecuencia y reincidencia de las visitas, el tiempo de visita, el navegador que usan, el operador o tipo de terminal desde el que se realiza la visita.</p>\r\n\r\n<p>Esta informaci&oacute;n la utilizamos para mejorar nuestra p&aacute;gina, detectar nuevas necesidades y valorar las mejoras a introducir con la finalidad de prestar un mejor servicio a los usuarios que nos visitan.</p>\r\n\r\n<p>Para permitir, conocer, bloquear o eliminar las cookies instaladas en tu equipo puedes hacerlo mediante la configuraci&oacute;n de las opciones del navegador instalado en su ordenador.</p>\r\n\r\n<p>Por ejemplo puedes encontrar informaci&oacute;n sobre c&oacute;mo hacerlo en el caso que uses como navegador:</p>\r\n\r\n<p>Firefox desde aqu&iacute;:&nbsp;http://support.mozilla.org/es/kb/habilitar-y-deshabilitar-cookies-que-los-sitios-we</p>\r\n\r\n<p>Chrome desde aqu&iacute;:&nbsp;http://support.google.com/chrome/bin/answer.py?hl=es&amp;answer=95647</p>\r\n\r\n<p>Explorer desde aqu&iacute;:&nbsp;http://windows.microsoft.com/es-es/windows7/how-to-manage-cookies-in-internet-explorer-9</p>\r\n\r\n<p>Safari desde aqu&iacute;:&nbsp;http://support.apple.com/kb/ph5042</p>\r\n\r\n<p>Opera desde aqu&iacute;:&nbsp;http://help.opera.com/Windows/11.50/es-ES/cookies.html</p>\r\n\r\n<p>&nbsp;</p>\r\n','','','','','','','','','','','','','','','Politica de Cookies | Pisosmanresa','politica-de-cookies','politica-de-cookies','politica de cookies','politica de cookies','INDEX,FOLLOW','','','ACTIVED',0),(12,'es','Buscador','Buscador','Buscador','','Encuentra tu alojamiento ideal','','0','0','','','0','0','','<p>0</p>\r\n','0','0','','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','Encuentra tu alojamiento ideal','buscador','buscador','alquiler piso Manresa, alquiler piso Artes, alquiler piso Avinyo, pisos Manresa, pisos Manresa, alquiler piso Callus, alquiler piso Castellbel i el Vilar, alquiler piso Castellgali','Alquiler, compra y venta de pisos, casas y villas en Manresa, Artes, Avinyo , Callus , Castellbell i el Vilar , Castellgali , Castellnou de Bages , El Pont de Vilomara i Rocafort , Fonollosa','INDEX,FOLLOW','','','ACTIVED',0),(13,'es','Condiciones Generales','Condiciones Generales','Condiciones Generales','29','Condiciones Generales','<p>&nbsp;</p>\r\n\r\n<p>Todas las operaciones que PisosManresa, S.L. realiza para los propietarios de bienes inmuebles, ya sea para supuestos de venta, alquiler, asesoramiento jur&iacute;dico legal, financiero u otras gestiones diversas, como pueden ser, cambios de titularidad en suministros, actos de representaci&oacute;n ante entidades p&uacute;blicas o privadas, se entienden perfeccionadas, por la intermediaci&oacute;n de la inmobiliaria, en todos los supuestos en los que el cliente o receptor final de los servicios obtiene el beneficio de nuestros trabajos y los acepta. Dichos trabajos, sin excepci&oacute;n, se realizan a t&iacute;tulo oneroso, en las condiciones econ&oacute;micas reflejadas en los mandatos y documentos an&aacute;logos y obligan a la contraprestaci&oacute;n econ&oacute;mica siempre que la inmobiliaria realice su trabajo y, tambi&eacute;n, cuando el mandato se malogre por causas imputables al mandatario o cliente si act&uacute;a con mala fe y el &aacute;nimo de no cumplir con sus contraprestaciones.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PisosManresa, S.L., perteneciente a la Red FindHouse, en adelante, FindHouse, se compromete a gestionar la venta del inmueble a todos los posibles compradores interesados en adquirir una propiedad de estas caracter&iacute;sticas durante el per&iacute;odo establecido. Todas estas gestiones ser&aacute;n realizadas por Agentes inmobiliarios contratados por la empresa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El personal de FindHouse acompa&ntilde;ar&aacute; siempre a los posibles compradores. Si el propietario reside en el inmueble objeto del contrato, ser&aacute; avisado previamente a cada visita. Las partes firmar&aacute;n el correspondiente parte que acredite la visita.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Se autoriza expresamente y sin ning&uacute;n g&eacute;nero de duda a Fincay&reg; Home a recibir se&ntilde;al o reserva de un futuro comprador, de acuerdo con el precio y condiciones de venta autorizadas expresamente por el propietario. Una vez recibida una se&ntilde;al o reserva por parte de un comprador, se pondr&aacute; en conocimiento del propietario. La Agencia Inmobiliaria queda facultada para hacer suya, en concepto de honorarios, las cantidades entregadas como se&ntilde;al o reserva. Si las cantidades entregadas no fueran suficientes para cubrir los honorarios pactados en este contrato, el vendedor queda obligado a abonar los honorarios pendientes de pago m&aacute;s el I.V.A. antes del otorgamiento de la compraventa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El propietario queda obligado por este contrato a no promocionar ni ofrecer la gesti&oacute;n de venta del inmueble objeto de este contrato a ninguna otra persona f&iacute;sica o jur&iacute;dica ni hacer gestiones directas tendentes a la venta del inmueble al margen de la Agencia Inmobiliaria sino a trav&eacute;s de la misma, de tal forma que, si el propietario aporta el comprador, Fincay&reg; Home se encargar&aacute; de todo lo necesario para la formalizaci&oacute;n y el buen fin de la compraventa.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El propietario abonar&aacute; a Global Or&aacute;ngutan, SL, perteneciente a la Red FindHouse, los honorarios &iacute;ntegros acordados en este contrato de encargo en todos los casos, salvo pacto en contrario.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Como contraprestaci&oacute;n por los servicios que presta la inmobiliaria, si durante el per&iacute;odo de vigencia del presente contrato o en el a&ntilde;o siguiente a la expiraci&oacute;n del mismo, el cliente vendiera directamente el inmueble al margen de la inmobiliaria o a trav&eacute;s de otro intermediario a cualquier comprador propuesto por Fincay&reg; Home, vendr&aacute; obligado al abono de un importe equivalente a los honorarios pactados anteriormente</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El propietario queda obligado por este contrato la propiedad objeto del mismo libre de cargas y grav&aacute;menes, incluidas las registrales. Tambi&eacute;n transmitir&aacute; la propiedad libre de deudas por impuestos o arbitrios, sin deudas con la Comunidad de Propietarios a la que pertenezca el inmueble y sin ocupantes por t&iacute;tulo cualquiera.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Todos los gastos e impuestos que se originen en esta transmisi&oacute;n ser&aacute;n por cuenta del comprador, salvo el impuesto de Incremento de Valor de los Terrenos de Naturaleza Urbana (antigua Plusval&iacute;a), que ser&aacute; por cuenta del vendedor.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>De acuerdo con lo prevenido en el R.D. 235/2013, los propietarios de viviendas y locales destinados a la venta o al arrendamiento contar&aacute;n, con car&aacute;cter previo, con el Certificado de Eficiencia Energ&eacute;tica y los inmuebles exhibir&aacute;n la correspondiente etiqueta energ&eacute;tica.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A tenor de lo establecido en Ley Org&aacute;nica 3/2018, de 5 de diciembre, de Protecci&oacute;n de Datos Personales y garant&iacute;a de los derechos digitales, que contempla, a su vez, el Reglamento (UE) 2016/679, informamos al vendedor que los datos que nos facilite ser&aacute;n tratados en los ficheros automatizados y/o en papel propiedad de FindHouse, S.L. con el fin de mantener la relaci&oacute;n precontractual, contractual y para la gesti&oacute;n interna entre empresa y cliente.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>El cliente podr&aacute; en cualquier momento ejercer el derecho de acceso, rectificaci&oacute;n, cancelaci&oacute;n y oposici&oacute;n mediante solicitud escrita y firmada, con copia del DNI/NIE/NIF, dirigida al Responsable del Fichero FindHouse, S.L., con domicilio en la calle P&iacute;o Baroja, 21, 03203 Barcelona o, tambi&eacute;n, a trav&eacute;s del correo electr&oacute;nico info@ffindhouse.com</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Para cualquier litigio que pueda producirse por la interpretaci&oacute;n de los contratos y/o mandatos suscritos entre FindHouse y las partes intervinientes en las operaciones de compraventa y/o arrendamiento, todos, renunciando al fuero que pudiera corresponderles, se someten a los Juzgados y Tribunales de la ciudad de Barcelona.</p>\r\n','','','','','','','','','','','','','','','Condiciones generales','condiciones-generales','condiciones-generales','condiciones generales','condiciones generales','INDEX,FOLLOW','','','ACTIVED',0),(14,'es','Formulario Opinión','Formulario de Opinión','¡Tu opinión es importante!','','Formulario de Opinión','','0','0','','','0','0','','<p>0</p>\r\n','0','0','','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','Formulario Opinión','formulario-opinion','formulario-de-opinion','formulario de opinion','formulario de opinion','INDEX,FOLLOW','','','ACTIVED',0),(15,'es','Realstate - Preguntas frecuentes','Preguntas frecuentes','compraventa','','Preguntas frecuentes','<p>En esta sección encontrará una selección de las preguntas más frecuentes. Si tiene alguna otra duda puede consultarnos a través de nuestra sección de contacto.</p>\r\n','0','0','','','0','0','','<p>0</p>\r\n','0','0','','<p>0</p>\r\n','<p>0</p>\r\n','<p>0</p>\r\n','','preguntas-frecuentes','preguntas-frecuentes','preguntas frequentes','preguntas frequentes','INDEX,FOLLOW','','','ACTIVED',0),(16,'es','Contacto','Contacto','contacto','29','PisosManresa: JUNTOS MARCAMOS LA DIFERENCIA','<p>En PisosManresa ponemos a tu disposici&oacute;n a un asesor personal para que te ayude a decidir si se trata o no de tu oportunidad. Un profesional que conoce el mercado y las oportunidades que van apareciendo, que tendr&aacute; en cuenta lo que buscas, d&oacute;nde lo buscas y al precio que est&eacute;s dispuesto a pagar, para poder recomendarte las mejores opciones.</p>\r\n\r\n<p>En definitiva, nuestro asesor personal te ayudar&aacute; a que la decisi&oacute;n sea mucho m&aacute;s sencilla para ti, d&aacute;ndote una&nbsp;<strong>respuesta en menos de 48 horas</strong>&nbsp;siempre que sea posible, y&nbsp;<strong>asesor&aacute;ndote acerca de la financiaci&oacute;n</strong>&nbsp;que necesitas.</p>\r\n\r\n<p>Todo lo que haga falta para conseguir que la oportunidad que encuentres se convierta finalmente en tu oportunidad.</p>\r\n\r\n<p><strong>La diferencia entre encontrar una oportunidad y que una oportunidad te encuentre a ti.</strong></p>\r\n','','','','','','','','','','','','','','','Contacta con nosotros','','contacto','contacto','contacto','INDEX,FOLLOW','','','ACTIVED',0),(17,'es','Mapa Web PisosManresa','Mapa Web PisosManresa','','','LOS DESTINOS FAVORITOS DE NUESTROS CLIENTES EN MANRESA','<div>\r\n<p>LOS DESTINOS FAVORITOS DE NUESTROS CLIENTES EN MANRESA</p>\r\n\r\n<ul>\r\n	<li>Artes Un destino familiar con una gran oferta de actividades y ocio</li>\r\n	<li>Avinyo &nbsp;Lujoso destino que ha sabido mantener su esp&iacute;ritu. &iexcl;Desc&uacute;bralo con PisosManresa!</li>\r\n	<li>Callus &nbsp;Largas playas y entretenimiento acu&aacute;tico garantizados.</li>\r\n	<li>Castellbell i el Vilar&nbsp;Aguas turquesas y arena blanca. &iexcl;La combinaci&oacute;n perfecta para sus casas!</li>\r\n	<li>Castellgali&nbsp;Lugar tranquilo junto a la monta&ntilde;a para pasar la tarde</li>\r\n</ul>\r\n\r\n<p>DESCUBRE NUESTRA GRAN OFERTA DE ALOJAMIENTOS EN MANRESA</p>\r\n\r\n<ul>\r\n	<li>Castellnou de Bages Alquiler de apartamentos, casas o villas con piscina privada en un entorno familiar</li>\r\n	<li>El Pont de Vilomara i Rocafort Disponemos de una gran oferta de alojamientos tanto en el centro como en las afueras de Manresa</li>\r\n	<li>Fonollosa Amplio abanico de posibilidades a la hora de alquilar un apartamento cerca de la monta&ntilde;a</li>\r\n	<li>Artes Alquile su villa con piscina privada o un apartamento en primera l&iacute;nea de monta&ntilde;a</li>\r\n	<li>Artes Acceso directo a las fant&aacute;sticas monta&ntilde;as naturales. Encuentre su piso o casa ideal con PisosManresa</li>\r\n</ul>\r\n\r\n<p>ACTIVIDADES DIVERTIDAS EN MANRESA</p>\r\n\r\n<p><strong>PARQUES TEM&Aacute;TICOS </strong></p>\r\n\r\n<ul>\r\n	<li>PORT AVENTURA WORLD&nbsp;gran parque tem&aacute;tico lleno de atracciones y espect&aacute;culos.</li>\r\n	<li>FERRARI LAND&nbsp;velocidad y emociones. &iexcl;Adrenalina garantizada!</li>\r\n	<li>COSTA CARIBE&nbsp;parque acu&aacute;tico en Salou para toda la familia</li>\r\n	<li>AQUOPOLIS&nbsp;divi&eacute;rtase en este espectacular parque acu&aacute;tico</li>\r\n</ul>\r\n\r\n<p><strong>AVENTURAS Y DEPORTES</strong></p>\r\n\r\n<ul>\r\n	<li>GOLF&nbsp;los mejores campos de Golf en Manresa</li>\r\n</ul>\r\n\r\n<p><strong>ESPECTACULOS</strong></p>\r\n\r\n<ul>\r\n	<li>CIRQUE DU SOLEIL&nbsp;sorprendente espect&aacute;culo del mejor circo del mundo</li>\r\n	<li>CONCURSO DE FUEGOS ARTIFICIALES&nbsp;los mejores fuegos artificiales en Manresa</li>\r\n</ul>\r\n\r\n<p><strong>SHOPPING</strong></p>\r\n\r\n<ul>\r\n	<li>BARCELONA&nbsp;visita imprescindible durante su estancia en Manresa</li>\r\n	<li>ANDORRA&nbsp;de compras con vistas a la monta&ntilde;a</li>\r\n	<li>REUS&nbsp;gran abanico de tiendas tanto nacionales como de grandes firmas internacionales</li>\r\n	<li>LA ROCA VILLAGE&nbsp;conozca el mejor Outlet</li>\r\n</ul>\r\n\r\n<p><strong>CULTURA Y MUSEOS</strong></p>\r\n\r\n<ul>\r\n	<li>LA RUTA DEL CISTER&nbsp;ruta por varios Monasterios, patrimonio de la Humanidad</li>\r\n	<li>LA RUTA DEL MODERNISMO&nbsp;Una excursi&oacute;n al coraz&oacute;n del modernismo: REUS</li>\r\n	<li>TARRAGONA&nbsp;moderna con vestigios del Imperio Romano, ciudad patrimonio de la humanidad</li>\r\n	<li>RUTA DE DAL&Iacute; POR LA COSTA BRAVA&nbsp;descubra Dal&iacute; y sus genialidades</li>\r\n	<li>MONTSERRAT&nbsp;monasterio en la monta&ntilde;a</li>\r\n	<li>BARCELONA&nbsp;descubra la cosmopolita ciudad de Barcelona</li>\r\n</ul>\r\n\r\n<p><strong>RELAX</strong></p>\r\n\r\n<ul>\r\n	<li>LUMINE MOUNTAIN CLUB relax en un exclusivo entorno en la playa</li>\r\n	<li>AQQUUM SPA &ndash; RELAX &amp; DISE&Ntilde;O&nbsp;excelente entorno para relajarse</li>\r\n	<li>LE MERIDIEN RA BEACH HOTEL &amp; SPA&nbsp;lujoso Spa en Manresa</li>\r\n</ul>\r\n\r\n<p>LAS MEJORES PROMOCIONES &ndash; DESCUENTOS EN MANRESA</p>\r\n\r\n<ul>\r\n	<li>RESERVA ANTICIPADA descuento del 10% si reserva antes del 31/12/2018</li>\r\n	<li>VIC CLUB PisosManresa descuentos y ventajas para nuestros clientes repetidores</li>\r\n	<li>LARGAS ESTANCIAS 10% de descuento si reserva 21 noches o m&aacute;s</li>\r\n	<li>&Uacute;LTIMA HORA ofertas Last Minute de hasta &ndash; 50%</li>\r\n</ul>\r\n\r\n<p>PREGUNTAS FRECUENTES &ndash; ALOJAMIENTOS VACACIONALES MANRESA</p>\r\n\r\n<p>RESERVAS Y ANULACIONES</p>\r\n\r\n<ul>\r\n	<li>C&oacute;mo hacer una reserva</li>\r\n	<li>C&oacute;mo anular una reserva</li>\r\n	<li>C&oacute;mo modificar una reserva</li>\r\n</ul>\r\n\r\n<p>SERVICIOS ADICIONALES</p>\r\n\r\n<ul>\r\n	<li>Pack bebe (cuna + trona)</li>\r\n	<li>Limpieza Final</li>\r\n	<li>Alquiler toallas de piscina / playa</li>\r\n	<li>Animales de compa&ntilde;&iacute;a</li>\r\n	<li>Llegada Tarde</li>\r\n	<li>Garant&iacute;a de anulaci&oacute;n / modificaci&oacute;n</li>\r\n	<li>Check in ONLINE</li>\r\n	<li>WIFI</li>\r\n	<li>Parking</li>\r\n</ul>\r\n\r\n<p>INFORMACI&Oacute;N SOBRE SU ALQUILER</p>\r\n\r\n<ul>\r\n	<li>Fianza</li>\r\n	<li>Inventario / Ropa de cama</li>\r\n	<li>Limpieza</li>\r\n</ul>\r\n\r\n<p>PROPIETARIOS &ndash; RENTABILIDAD DE SU PISO EN MANRESA</p>\r\n\r\n<p>Alquile con PisosManresa su propiedad y saque un alto rendimiento</p>\r\n\r\n<p>SOBRE NOSOTROS</p>\r\n\r\n<p>La historia y el futuro de PisosManresa, especialista en pisos, casas, villas en Manresa</p>\r\n\r\n<p>COMPRA VENTA DE PROPIEDADES</p>\r\n\r\n<p>Artes, Avinyo , Callus , Castellbell i