  `dynamic_documents_usuario` int(11) DEFAULT '0' COMMENT 'Documentos Usuario',
  `dynamic_gallery_usuario` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Galería Usuario',
  `dynamic_gallery_inmo` varchar(45) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Galería Fotos',
  `text_zona` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Zona ej:Carretera de sants',
  `text_antiguedad` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Antiguedad  (1992, 2004)',
