  `textarea_description` mediumtext COLLATE utf8mb4_unicode_ci COMMENT 'Descripción principal',
  `textarea_description_2` mediumtext COLLATE utf8mb4_unicode_ci COMMENT 'Descripción secundaria',
  `textarea_interior` mediumtext COLLATE utf8mb4_unicode_ci COMMENT 'Descripción opcional (No visible)',
  `checkbox_destacado` tinyint(45) DEFAULT '0' COMMENT 'Destacado',
